import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import Navbar from './components/Navbar';  // ✅ Import Navbar

function App() {
  return (
    <Router>
      <>
      <Navbar />
      </>

       {/* ✅ Navbar placed outside Routes */}
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
